import React, {useEffect} from "react";
import CustomButton from '../../../components/button'
import Input from '../../../components/input';
import "antd/dist/antd.css";
import styled from 'styled-components';
import Modal from "../../../components/modal";
import {profileConfig} from "../configs/profile-config";
import {Form} from "antd";
import Items from "./items";

interface InfoItem {
    email: string;
    name: string;
    phone: string;
    username: string;
    website: string;
}

interface ProfileProps {
    infos: InfoItem;
    modalIsVisible: boolean;
    infoLoading: boolean;
    showModal: () => void;
    hideModal: () => void;
    getInfo: () => void;
}

const ProfileContainer = styled.div
    `
    display: grid;
`
;

const Profile = (props: ProfileProps) => {

    const {
        infos,
        modalIsVisible,
        infoLoading,
        showModal,
        hideModal,
        getInfo
    } = props;

    useEffect(() => {
        getInfo();
    }, [getInfo]);

    return (
        <ProfileContainer>
            <span>{profileConfig.pageName}</span>
            <Form>
            <Items infos={infos}/>
            </Form>
            <div>
                {infos.name}
            </div>
            <CustomButton
                type="primary"
                onClick = {showModal}
            >
                {profileConfig.buttonText}
            </CustomButton>
            <Modal
                title={profileConfig.modalName}
                onOk={hideModal}
                onCancel={hideModal}
            >
                <p>Some contents...</p>
                <p>Some contents...</p>
                <p>Some contents...</p>
            </Modal>
        </ProfileContainer>
    );
}

export default Profile;
